import logo from './logo.svg';
import './App.css';
import Header from "./component/header/Header"
import MyNavbar from './component/header/Navbar';
import CarouselComponent from './component/header/Carousel';
import TeamCard from './component/header/Teamcard';
import teamcard from './component/header/Teamcard';



const teamCard = [
  {
    title:"card1",
    images:""
  },
  {
    title:"card2",
    images:""
  }
]

function App() {


  return (
    <div>
    <Header/>  
    <MyNavbar/>
    <CarouselComponent/> 
    <TeamCard/> 

   <div className="container">
      <h2>Good Morning!</h2>
      <p>Curated shorts for you</p>
      <div className="scroll-wrapper">
        {teamcard.map((item) => (
          <div key={item.id} className="img-tile">
            <img src={item.image} alt={item.title} />
            <p>{item.title}</p>
          </div>
        ))}
      </div>
    </div>

    </div>
  );
}

export default App;
